import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
	logoHeader: {
		marginTop: 30,
		alignSelf: "center",
	},

	dontHaveAccount: {
		textAlign: "center",
		fontFamily: "NunitoSans_800ExtraBold",
		fontSize: 12,
	},

	linkClick: {
		color: "#4477FF",
	},
});

export default styles;
